import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faFacebookF } from "@fortawesome/free-brands-svg-icons";
import { faInstagram } from "@fortawesome/free-brands-svg-icons";
import { faTwitter } from "@fortawesome/free-brands-svg-icons";
import { faYoutube } from "@fortawesome/free-brands-svg-icons";

function Bottom() {
  return (
    <div className="absolute w-full h-72 bg-#4ECDC4 h-screen overflow-hidden bg-teal-400">
        <div className="absolute top-16 left-20">
            <h1 className="text-lg tracking-widest">
                FOLLOW US
            </h1>
        </div>
        <div className="absolute top-24 left-12 space-x-6">
            <FontAwesomeIcon icon={faFacebookF} className="w-8 h-8"/>
            <FontAwesomeIcon icon={faInstagram} />
            <FontAwesomeIcon icon={faTwitter} />
            <FontAwesomeIcon icon={faYoutube} />
            </div>
    </div>
  )
}

export default Bottom
